import React from 'react';
import { View, Text, StyleSheet, ImageBackground } from 'react-native';

export default function Dashboard() {
    return (
        <ImageBackground source={require('../../assets/BACKGROUND.png')} resizeMode='cover' style={styles.background}>
            <View style={styles.container}>
                <View style={styles.textContainer}>
                    <Text style={styles.text}>
                        {'\t\t\t'}Goals{'\n\t'} Steps{'\t\t\t\t'} Calories
                        {'\n\t'} 10782 {'\t\t\t\t'}1992
                    </Text>
                </View>
            </View>
        </ImageBackground>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
        paddingTop: 0.1,
        backgroundColor: 'transparent', // Set the background of the container to be transparent
        padding: 8,
    },
    textContainer: {
        backgroundColor: 'rgba(255, 105, 180, 0.7)', // Semi-transparent hotpink background
        borderWidth: 1,
        borderColor: 'white',
        borderRadius: 4,
    },
    text: {
        fontSize: 25,
        height: 200,
        width: '100%',
        color: 'white', // Set the text color to blue
    },
    background: {
        flex: 1,
        resizeMode: 'cover',
    },
});
